import './css/App.css';
import React from 'react'
import Login from "./loginpg"
import Signup from "./signuppg"
var logged = false;
var signup = false;

var click_sign = ()=>{
  signup = true;
  return signup;
}

function App() {
  if(logged === false){
    return(
      <Login/>
    )
  }
  else if(click_sign() === true){
    return(
      <Signup/>
    )
  }
  return (
    <div className="App">
      <Signup/>
    </div>
  );
}

export default App;
